static void
video_skeleton_class_init (VideoSkeletonClass *klass)
{
  GObjectClass *gobject_class;
  GDBusInterfaceSkeletonClass *skeleton_class;

  gobject_class = G_OBJECT_CLASS (klass);
  gobject_class->finalize = video_skeleton_finalize;
  gobject_class->get_property = video_skeleton_get_property;
  gobject_class->set_property = video_skeleton_set_property;
  gobject_class->notify       = video_skeleton_notify;


  video_override_properties (gobject_class, 1);

  skeleton_class = G_DBUS_INTERFACE_SKELETON_CLASS (klass);
  skeleton_class->get_info = video_skeleton_dbus_interface_get_info;
  skeleton_class->get_properties = video_skeleton_dbus_interface_get_properties;
  skeleton_class->flush = video_skeleton_dbus_interface_flush;
  skeleton_class->get_vtable = video_skeleton_dbus_interface_get_vtable;

#if GLIB_VERSION_MAX_ALLOWED < GLIB_VERSION_2_38
  g_type_class_add_private (klass, sizeof (VideoSkeletonPrivate));
#endif
}

static void
video_skeleton_iface_init (VideoIface *iface)
{
  iface->record_start = _video_on_signal_record_start;
  iface->record_stop = _video_on_signal_record_stop;
  iface->get_str_property = video_skeleton_get_str_property;
  iface->get_byte_property = video_skeleton_get_byte_property;
  iface->get_bool_property = video_skeleton_get_bool_property;
  iface->get_int16_property = video_skeleton_get_int16_property;
  iface->get_uint16_property = video_skeleton_get_uint16_property;
  iface->get_int32_property = video_skeleton_get_int32_property;
  iface->get_uint32_property = video_skeleton_get_uint32_property;
  iface->get_int64_property = video_skeleton_get_int64_property;
  iface->get_uint64_property = video_skeleton_get_uint64_property;
  iface->get_double_property = video_skeleton_get_double_property;
  iface->get_array_str_property = video_skeleton_get_array_str_property;
  iface->get_array_uint32_property = video_skeleton_get_array_uint32_property;
}

